import React, { useState } from 'react';
import { Box, AppBar, Toolbar, IconButton, Typography, ThemeProvider, CssBaseline, Drawer, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import SettingsIcon from '@mui/icons-material/Settings';
import ShowChartIcon from '@mui/icons-material/ShowChart';
import { Provider } from 'react-redux';
import { store } from './store/index';
import { theme } from './theme';
import MainContent from './components/MainContent';
import { AccessTokenInput } from './components/Auth/AccessTokenInput';

function AppContent() {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [showSettings, setShowSettings] = useState(false);

  const toggleDrawer = () => {
    setDrawerOpen(!drawerOpen);
  };

  const handleSettingsClick = () => {
    setShowSettings(true);
    setDrawerOpen(false);
  };

  const handleTradingClick = () => {
    setShowSettings(false);
    setDrawerOpen(false);
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" color="primary">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
            onClick={toggleDrawer}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1, fontWeight: 'bold' }}>
            KAVAS CAPITAL
          </Typography>
        </Toolbar>
      </AppBar>

      <Drawer anchor="left" open={drawerOpen} onClose={toggleDrawer}>
        <List sx={{ width: 250 }}>
          <ListItem button onClick={handleTradingClick}>
            <ListItemIcon>
              <ShowChartIcon />
            </ListItemIcon>
            <ListItemText primary="Trading" />
          </ListItem>
          <ListItem button onClick={handleSettingsClick}>
            <ListItemIcon>
              <SettingsIcon />
            </ListItemIcon>
            <ListItemText primary="Settings" />
          </ListItem>
        </List>
      </Drawer>

      {showSettings ? (
        <Box sx={{ p: 3 }}>
          <Typography variant="h5" gutterBottom>
            Settings
          </Typography>
          <AccessTokenInput />
        </Box>
      ) : (
        <MainContent />
      )}
    </Box>
  );
}

const App: React.FC = () => {
  return (
    <Provider store={store}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <AppContent />
      </ThemeProvider>
    </Provider>
  );
};

export default App;
